[{"location":"","page":"Home","title":"Home","text":"CurrentModule = YaoHIR","category":"page"},{"location":"#YaoHIR","page":"Home","title":"YaoHIR","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [YaoHIR]","category":"page"},{"location":"#YaoHIR.AdjointOperation","page":"Home","title":"YaoHIR.AdjointOperation","text":"AdjointOperation{P} <: Routine\n\nAn AdjointOperation is the adjoint of another Routine.\n\n\n\n\n\n","category":"type"},{"location":"#YaoHIR.GenericRoutine","page":"Home","title":"YaoHIR.GenericRoutine","text":"GenericRoutine{name} <: Function\n\nA GenericRoutine cannot be directly execute on a quantum device. It is a Julia Function that returns Operation, and Operation can be executed on quanutm device.\n\nnote: Note\nAn instance of GenericRoutine should be treated like Function.\n\n\n\n\n\n","category":"type"},{"location":"#YaoHIR.IntrinsicRoutine","page":"Home","title":"YaoHIR.IntrinsicRoutine","text":"abstract type IntrinsicRoutine <: Routine end\n\nIntrinsicRoutine are the routine that can be executed by the compile target that is pre-defined in the compiler.\n\n\n\n\n\n","category":"type"},{"location":"#YaoHIR.Operation","page":"Home","title":"YaoHIR.Operation","text":"Operation{P, Args} <: Routine\n\nAn Operation is a user defined composite routine that can be called in other Operation or execute on target device.\n\n\n\n\n\n","category":"type"},{"location":"#YaoHIR.Routine","page":"Home","title":"YaoHIR.Routine","text":"abstract type Routine end\n\nThis defines operations that one can execute on a quantum device.\n\n\n\n\n\n","category":"type"}]
